import React, { Component } from 'react';
import { Carousel, Jumbotron, Button} from 'react-bootstrap';

import family1 from '../images/family1.jpg';
import family2 from '../images/family2.jpg';


export default class HomePage extends  Component {
    render(){
        return (
            <div>
                <Carousel fade="true" interval="1000" style={{height:"600px", width:"100%"}}>
                    <Carousel.Item>
                        <img
                            className="d-block w-100"
                            src={family1}
                            alt="First slide"
                            style={{height:"600px", width:"100%"}}
                            />
                    </Carousel.Item>
                    <Carousel.Item>
                        <img
                            className="d-block w-100"
                            src={family2}
                            alt="Third slide"
                            style={{height:"600px", width:"100%"}}
                            />
                    </Carousel.Item>
                </Carousel>
                <Jumbotron style={{textAlign: "center"}} fluid>
                    <h2>Why chose CCICC</h2>
                    <p>
                        This is a simple hero unit, a simple jumbotron-style component for calling
                        extra attention to featured content or information.
                    </p>
                    <p>
                        <Button variant="primary">Learn more</Button>
                    </p>
                </Jumbotron>
                <Jumbotron style={{textAlign: "center", backgroundColor: "orange"}} fluid>
                    <h1>Customer Speak</h1>
                </Jumbotron>
            </div>
        );
    }
}
